        return (
            <div>
                <div>
                    <img alt='Nothing Yet'/>
                    <p>John Smith</p>
                    <p>021 123 456</p>
                    <p>john-smith@thecarcompany.co.nz</p>
                </div>
            </div>
        );
    }
}

